New year, so a reminder that this FB page is all about info and photos. Questions need to be directed to info@rockwellhigh.net or by calling 801-789-7625.

Speaking of info...
Volleyball is at Freedom Prep today;
Baseball is home vs. Maeser, 4 pm;
Volleyball is at APA-West Valley on Thursday.
Cross Country is at a meet at Lakeside Park in Orem on Friday;
Baseball is at APA-Draper, Friday at 4 pm; and
No School on Monday - Happy Labor Day!

